import React from 'react';
import { Link } from 'react-router-dom';

const UserHome = () => {
  return (
    <div className="user-home max-w-lg mx-auto mt-10 p-5 bg-white rounded-lg shadow-md">
      <h2 className="text-2xl font-semibold text-center mb-5">Welcome to Your Dashboard</h2>
      <p className="text-center mb-4">Here are your options:</p>
      <div className="space-y-4">
        <Link
          to="/make-payment"
          className="block w-full p-3 bg-blue-600 text-white rounded text-center hover:bg-blue-700 transition duration-300"
        >
          Make a Payment
        </Link>
        <Link
          to="/payment-history"
          className="block w-full p-3 bg-green-600 text-white rounded text-center hover:bg-green-700 transition duration-300"
        >
          View Payment History
        </Link>
      </div>
    </div>
  );
};

export default UserHome;
